import {Link} from 'react-router-dom';

export default class CreerEnchere extends Component {
  render() {
    return (
      
                <div className="container py-5">
                   {/* title */ }
                   <input class="form-control" type="text" placeholder="Le nom du produit"></input>
                   {/* end title */}

                   {/* produit info */}


                   
                   <div className="row">
                       {/* img */}
                      <div className="col-10 mx-auto col-md-6 my-3 text-capitalize">
                      <h5>Ajouter une photo de votre produit</h5>
                      <input type="file" class="form-control-file" id="exampleFormControlFile1" /> 
                     </div>
                      
                        {/* end img */}


                      <div className="col-10 mx-auto col-md-6 my-3 text-capitalize">
                         <h3>Model : </h3>
                         <h4 className="text-title text-uppercase text-muted mt-3 mb-2"> Made by :<span className="text-uppercase"></span></h4>
                         <h4 className="text-blue"><strong> Prix :  <span>â‚¬</span></strong></h4>
                         <p className="text-capitalize font-weight-bold mt-3 mb-0"> Informations sur le produit :</p>
                         <p className="text-muted lead"></p>

                         {/* bouttons */}
                         <div>
                              
                              <Link to="/enchereList">

                              <button type="button" class="btn btn-primary ">
                              Annuler
                              </button>
                                
                              </Link>
                              

                              <button type="button" class="btn btn-warning ml-3">
                              
                              
                              </button>
                              


                              


                         </div>
                      </div>

                    </div>
                </div>
            )
          }}
